window.bookSummaryJSON = "<p>When Rosalen Maldonado tinkers with the derelict freighter, she's just hoping to prove she deserves a scholarship to University. She certainly doesn't count on waking the ship's damaged AI or having three stowaways, Micah Rotherwood and brothers Jem and Barre Durbin, along for the ride. They all have their private reasons for hiding aboard and lives they are seeking to escape, but if the accidental crew can't work together and learn to trust each other, they'll die together, victims of a computer that doesn't realize the war ended decades before any of them were even born. </p>"; 
